import React from 'react';

import { Navbar } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
    .navbar { background-color: #222; }
    a, .navbar-nav, .navbar-light .nav-link {
        color: #9FFFCB;
        &:hover { color: white; }
    }
    .navbar-brand {
        font-size: 1.4em;
        color: #9FFFCB;
        padding: 1.4em 0;
        &:hover { color: white; }
    }
`;

function Header() {

    return (
        <Styles>
            <Navbar expand="lg">
                <Navbar.Brand href="#" >Laravel Socket</Navbar.Brand>
            </Navbar>
        </Styles>
    );

}

export default Header;
